<html lang="en"><head><title>Tournaments: Dota 2, LoL, CS:GO, Fortnite, PUBG | PLAY cyberchallenger</title><meta charset="utf-8"><meta name="author" content="cyberchallenger"><meta name="viewport" content="width=device-width, initial-scale=1.0"><style>位于栃木县宇都宫市的栃木县立博物馆正在举办一个别出心裁的日本画展览会，题为《大叔们的聚首》。展出室町时代到江户时代以中国典故为题材的16组屏风画和挂轴画等作品，画中均有“大叔”登场。室町时代的画作《虎溪三笑山水图》由三幅挂轴构成，正中央的一幅描绘了正在修行的僧侣与两位来访的友人谈笑风生的情景。挂轴画《兰亭曲水图》创作于江户时代后期，再现了40多人设宴泛觞赋诗的场景。还有描绘形形色色的中国“大叔们“或汇聚一堂、或举杯畅饮的画作。栃木县立博物馆策展员久野华步说：“请仔细观察这些大名鼎鼎的僧侣和官僚等大叔们的表情，希望本次展览能够成为让更多人熟悉日本画的一个契机。”展览会将举办至4月2日。</style><style>.team-items .item.active{background: rgba(55, 66, 76, 0.4) repeat scroll 0 0; border: 1px solid #2bd077; position: relative;}.team-items .item.active::before{content: ""; position: absolute; top: 10px; right: 10px; width: 10px; height: 10px; border-radius: 50%; background: #2bd077;}</style><style>@charset "UTF-8";.wp-block-archives-dropdown label{display:block}.wp-block-avatar{box-sizing:border-box}.wp-block-avatar.aligncenter{text-align:center}.wp-block-audio{box-sizing:border-box}.wp-block-audio figcaption{margin-top:.5em; margin-bottom:1em}.wp-block-audio audio{width:100%; min-width:300px}.wp-block-button__link{cursor:pointer; display:inline-block; text-align:center; word-break:break-word; box-sizing:border-box}.wp-block-button__link.aligncenter{text-align:center}.wp-block-button__link.alignright{text-align:right}:where(.wp-block-button__link){box-shadow:none; text-decoration:none; border-radius:9999px; padding:calc(.667em + 2px) calc(1.333em + 2px)}.wp-block-button[style*=text-decoration] .wp-block-button__link{text-decoration:inherit}.wp-block-buttons>.wp-block-button.has-custom-width{max-width:none}.wp-block-buttons>.wp-block-button.has-custom-width .wp-block-button__link{width:100%}.wp-block-buttons>.wp-block-button.has-custom-font-size .wp-block-button__link{font-size:inherit}.wp-block-buttons>.wp-block-button.wp-block-button__width-25{width:calc(25% - var(--wp--style--block-gap, .5em)*0.75)}.wp-block-butto