t/about/pic-3@3x.png.html 3x"></div></div></div><div class="fine-block left"><div class="small-container"><div class="text for-mobile"><div class="wrap"></p><h2><span class="t_lang" data-lang="about_support">Support</span></h2><p> <span class="t_lang" data-lang="about_supportInfo">PLAY cyberchallenger is rapidly growing, information volumes are constantly increasing, we require more resources to process growing amount of data and be more useful to the world community. Everyone is free to support our service and help us make cyberchallenger better, friendlier and cleaner. Donations are not required, but greatly appreciated!</span></div></div><div class="image"><imgsrc="data:image/svg+xml,%3Csvg xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink' width='523' height='310'%3E%3Cdefs%3E%3Cpath id='a' d='M27.36 7.2h4.677A3.962 3.962 0 0 1 36 11.162v13.676a3.962 3.962 0 0 1-3.963 3.962H27.36v3.958A3.242 3.242 0 0 1 24.12 36H3.24A3.24 3.24 0 0 1 0 32.758V1.078A1.08 1.08 0 0 1 1.081 0h25.198c.597 0 1.081.482 1.081 1.077V7.2zm0 3.6v14.4h3.96c.595 0 1.08-.485 1.08-1.082V11.882a1.08 1.08 0 0 0-1.08-1.082h-3.96z'/%3E%3Cpath id='c' d='M.4.08s1.052 3.55 1.052 4.594C1.452 5.717.4 8.72.4 8.72'/%3E%3Cpath id='d' d='M.4.08l.266.964'/%3E%3C/defs%3E%3Cg fill='none' fill-rule='evenodd'%3E%3Cpath fill='%23262729' d='M0 0h523v310H0z'/%3E%3Cg transform='translate(20 83)'%3E%3Cellipse cx='451' cy='140' fill='%232C2E30' rx='32' ry='4'/%3E%3Cg transform='translate(437 102)'%3E%3Cmask id='b' fill='%23fff'%3E%3Cuse xlink:href='%23a'/%3E%3C/mask%3E%3Cuse fill='%23FFF' fill-rule='nonzero' xlink:href='%23a'/%3E%3Cpath stroke='%232BD077' stroke-linecap='round' stroke-linejoin='round' stroke-width='1.5' d='M27.36 19.8l-4.53 3.555-4.475-3.555-4.675 3.555L9.13 19.8l-4.566 3.555L0 19.8' mask='url(%23b)'/%3E%3Cpath stroke='%231ED69D' stroke-linecap='round' stroke-linejoin='round' stroke-width='1.5' d='M0 12.6l4.564 3.6 4.566-3.6 4.55 3.6 4.675-3.6 4.474 3.6 4.531-3.6' mask='url(