4'/%3E%3C/g%3E%3C/g%3E%3C/g%3E%3C/svg%3E"></div><div class="text"><div class="wrap"></p></div></div></div></div></div></div></div><div id="pro-modal" class="modalWindow modalWindowPage" style="display:none;"><div class="model-content"><a " class="close_skinWindow"><svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" version="1.1" id="Capa_1" x="0px" y="0px" viewBox="0 0 512.001 512.001" style="enable-background:new 0 0 512.001 512.001;" xml:space="preserve"> <g> <g> <pathd="M284.286,256.002L506.143,34.144c7.811-7.811,7.811-20.475,0-28.285c-7.811-7.81-20.475-7.811-28.285,0L256,227.717 L34.143,5.859c-7.811-7.811-20.475-7.811-28.285,0c-7.81,7.811-7.811,20.475,0,28.285l221.857,221.857L5.858,477.859 c-7.811,7.811-7.811,20.475,0,28.285c3.905,3.905,9.024,5.857,14.143,5.857c5.119,0,10.237-1.952,14.143-5.857L256,284.287 l221.857,221.857c3.905,3.905,9.024,5.857,14.143,5.857s10.237-1.952,14.143-5.857c7.811-7.811,7.811-20.475,0-28.285 L284.286,256.002z"/> </g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> <g> </g> </svg></a><h1 class="page-title" style="text-align: center"><span class="t_lang">Features</span></h1><section class="cls_10"><div class="cls_5"><div class="row flex-row"><div class="col-md-7 hidden-sm hidden-xs"></div><div class="col-md-5 cls_11"><div class="flex-centred"><div class="big-label-outlined label-success"><span class="t_lang" data-lang="pro_alreadyAvailable">Already available</span></div><h2 class="section-title"> <span class="t_lang" data-lang="pro_viewership">Viewership statistics split by languages and platforms</span></h2><p class="section-text"> <span class="t_lang" data-lang="pro_viewershipInfo">PRO access provides additional numbers on viewers' peaks for all languages and platforms. For example, you can find out what the peak was on the Portuguese, Spanish, Korean and many other broadcasts.</span></p></div></div></div></div></section><section class="cls_10"><div class="cls_5"><div class="row flex-row"><div class="col-md-5 cls_11"><div class="flex-centred"><div class="big-label-outlined label-success"><span class="t_lang" data-lang="pro_alreadyAvailable">Already available</span></div><h2 class="section-title"> <span class="t_lang" data-lang="pro_filterPopular">Filter popular matches by language and platform</span></h2><p class="section-text"> <span class="t_lang" data-lang="pro_filterPopularInfo">See which matches gathered the biggest audience for particular language and/or platform. For example, you can find out the most popular matches among French audiences or viewers on YouTube.</span></p></div></div><div class="col-md-7 hidden-sm hidden-xs"></div></div></div></section><section class="cls_10"><div class="cls_5"><div class="row flex-row"><div class="col-md-7 hidden-sm hidden-xs"></div><div class="col-md-5 cls_11"><div class="flex-centred"><div class="big-label-outlined label-success"><span class="t_lang" data-lang="pro_alreadyAvailable">Already available</span></div><h2 class="section-title"> <span class="t_lang" data-lang="pro_mostPopular">Most popular teams of a tournament</span></h2><p class="section-text"> <span class="t_lang" data-lang="pro_mostPopularInfo">Find out who became the tournament stars! Which team has become the most popular? All this is available in the Pro version.</span></p></div></div></div></div></section><section class="cls_10"><div class="cls_5"><div class="row flex-row"><div class="col-md-5 cls_11"><div class="flex-centred"><div class="big-label-outlined label-success"><span class="t_lang" data-lang="pro_alreadyAvailable">Already available</span></div><h2 class="section-title"><span class="t_lang" data-lang="pro_twitchStatistics">Twitch statistics</span></h2><p class="section-text"> <span class="t_lang" data-lang="pro_twitchStatisticsInfo">Discover the channels that have broadcasted a tournament; channels total number, their views statistics and subscribers growth.</span></p></div></div><div class="col-md-7 hidden-sm hidden-xs"></div></div></div></section><section class="cls_10"><div class="cls_5"><div class="row flex-row"><div class="col-md-7 hidden-sm hidden-xs"></div><div class="col-md-5 cls_11"><div class="flex-centred"><div class="big-label-outlined label-success"><span class="t_lang" data-lang="pro_alreadyAvailable">Already available</span></div><h2 class="section-title"> <span class="t_lang" data-lang="pro_tournamentsInfographics">Tournaments infographics</span></h2><p class="section-text"> <span class="t_lang" data-lang="pro_tournamentsInfographicsInfo">All the infograpics are available at the tournament page directly; no need to go through our social networks to see them.</span></p></div></div></div></div></section><section class="cls_10"><div class="cls_5"><div class="row flex-row"><div class="col-md-5 cls_11"><div class="flex-centred"><div class="big-label-outlined label-success"><span class="t_lang" data-lang="pro_alreadyAvailable">Already available</span></div><h2 class="section-title"> <span class="t_lang" data-lang="pro_twitchChannels">Twitch channels and categories ratings</span></h2><p class="section-text"> <span class="t_lang" data-lang="pro_twitchChannelsInfo">Brand new section with no limits for you! Subscription will allow you to create your own rating according to your dates and other filters.</span></p></div></div><div class="col-md-7 hidden-sm hidden-xs"></div></div></div></section><section class="cls_10"><div style="padding-top: 45px" class="cls_5"><div class="row"><div class="col-md-4"><div class="card-block"><div class="big-label-outlined label-warning"><span class="t_lang" data-lang="pro_comingCoon">Coming soon</span></div><h2 class="section-title"> <span class="t_lang" data-lang="pro_tournamentsComparison">Tournaments comparison</span></h2><p class="section-text"> <span class="t_lang" data-lang="pro_tournamentsComparisonInfo">Which mobile game gather the biggest number of viewers? And what is more popul