yle="display: none">alnemohuani</span></span></h2><p> <span class="t_lang" data-lang="contact_partnershipInfo">We are open to partnership cooperation. Several prestigious universities have already started conducting full-fledged research with our data. We provide timely and detailed statistics about all cyberchallenger activities for cyberchallenger organizations, tournament organizers, and brands.</span></p><p>At the moment, you are not authorized and all the functions of the site are not availibale toyou, in order to enter the system, go through authorization through your steam accaunt. Onlyafter this, additional functions of our service will be availible to you. <aclass="cls_4-item-text goAuth" "><span class="t_lang" data-lang="signIn">S<span style="display: none">aad</span>i<span style="display: none">acchic</span>g<span style="display: none">aatch</span>n<span style="display: none">aam</span> i<span style="display: none">acchic</span>n<span style="display: none">aam</span></span></a></p></div></div></div></div></div><div id="privacy-modal" class="modalWindow modalWindowPage" style="display:none;"><div class="content"><div class="section section--contact-form"><div class="cls_5"><h2><span class="site_shortname">cyberchallenger</span> Privacy Policy</h2><p><span class="site_shortname">cyberchallenger</span> (<spanclass="site_shortname">cyberchallenger</span> Inc.) operates the <span class="site_name">PLAY cyberchallenger</span> website, which provides the SERVICE.</p><p>This page is used to inform website visitors regarding our policies with the collection, use,and disclosure of Personal Information if anyone decided to use our Service, the <spanclass="site_name">PLAY cyberchallenger</span> (<span class="site_url">eplaychart.pro</span>)website.</p><p>We at <span class="site_shortname">cyberchallenger</span> deeply respect the privacy of our on-linevisitors and recognize the importance of providing a secure environment for them.</p><p>By using this website and/or any of <span class="site_shortname">cyberchallenger</span> onlineproducts or services, you signify your assent to this Privacy Policy. If you do not agree tothis Privacy Policy, please do not use our websites. This Privacy Policy may change from time totime, so please check back periodically to ensure that you are aware of any changes. If we makea material change to this Privacy Policy, we will notify you by posting the change on ourwebsites or in this Privacy Policy and, if necessary, give you additional choices regarding suchchange prior to the change becoming effective. Your continued use of the <spanclass="site_name">PLAY cyberchallenger</span> website and services will signify your acceptanceof these changes.</p><p>If you are a visitor from outside the United States, the personal information you provide may betransferred to, stored, and processed within the United States or other countries where <spanclass="site_shortname">cyberchallenger</span> maintains facilities or business operations.</p><p>Please note that when you click a link to other sites from a <span class="site_name">PLAY cyberchallenger</span> website, this Privacy Policy does not apply to, and cannot control theactivities on those other sites. We highly recommend that you read the privacy policy of anythird party website you may be directed to before providing any personally identifiableinformation.</p><h3 style="margin-top: 50px">Who is processing your data?</h3><p><span class="site_shortname">cyberchallenger</span> Inc. is the data controller for the processingof your personal data. We are a registered company located at:</p><p><span class="site_shortname">cyberchallenger</span> Inc, 1178 Broadway, 2nd Floor #1011, New York,NY 10001</p><p>For the performance of certain services, your data may be controlled by <spanclass="site_shortname">cyberchallenger</span> Inc. in the United States.</p><h3 style="margin-top: 50px">The information that <span class="site_shortname">cyberchallenger</span> collects</h3><p>We collect information from or about you in the following ways:</p><p><b>Information provided by you</b>. Information provided by you when you create or update youraccount(s); while you use our tools or services; when you use any of our services for purchasesor financial transactions; and while you are receiving customer service support.</p><p><b>Information we get or generate from your use of our services</b>. We collect data related to:the services that you use and how you use them, and your activities when you install or accessour services.</p><p><b>Information collected from external sources</b>. We may receive information about you and youractivities from third parties when you link to external accounts (such as Facebook, Google,Twitter, VK, Discord, Steam or Twitch) and from advertisers or service providers about yourexperiences or interactions with them. We might also obtain information from public sites on theinternet, such as Twitch, Instagram and YouTube, to mention a few. For example, if you login toa site or app using Facebook Connect you may be asked if you wish to share information from yourFacebook account with us. If you use a "like" or a "share" button for a feature on our sites orapps, then the third party may share information with us.</p><p><b>We treat all information associated with your account as personal information.</b></p><h3 style="margin-top: 50px">How we use the information we collect</h3><p>We use the information we collect only in compliance with this Privacy Policy. Customers whosubscribe to our Subscription Service are obligated through our agreements with them to complywith this Privacy Policy. We will never sell your Personal Information to any third party.</p><p>In addition to the uses identified elsewhere in this Privacy Policy, we may use your PersonalInformation to: (a) improve your browsing experience (b) send information to you which we thinkmay be of interest to you by email (c) send you marketing communications relating to ourbusiness.</p><p>We use Navigational Information to operate and improve <spanclass="site_url">eplaychart.pro</span> and the Subscription Service. We may also useNavigational Information alone or in combination with Personal Information to provide you withpersonalized information about <span class="site_name">PLAY cyberchallenger</span>.</p><p>If you give us credit card information, we use it solely to check your financial qualificationsand collect payment from you. We use a third-party service provider to manage credit cardprocessing. This service provider is not permitted to store, retain, or use the information youprovide except for the sole purpose of credit card processing on our behalf.</p><h3 style="margin-top: 50px">Security of Your Personal Information</h3><p>We use a variety of security technologies and procedures to help protect your PersonalInformation from unauthorized access, use or disclosure. We secure the Personal Information youprovide on computer servers in a controlled, secure environment, protected from unauthorizedaccess, use or disclosure. When sensitive Personal Information (such as a credit card numberand/or geo-location data) is collected on our Websites and/or transmitted to other websites, itis protected through the use of encryption, such as the Secure Socket Layer (SSL) protocol.</p><h3 style="margin-top: 50px">Retention of Personal Information</h3><p>We retain Personal Information that you provide as long as we consider it potentially useful incontacting you about the Subscription Service or our other services, or as needed to comply withour legal obligations, resolve disputes and enforce our agreements, and then we securely deletethe information. We will delete this information from the servers at an earlier date if you sorequest, as described in Р Р†Р вЂљРЎС™Opting Out and UnsubscribingР Р†Р вЂљРЎСљ below.</p><h3 style="margin-top: 50px">Opting Out and Unsubscribing</h3><p>Upon request, <span class="site_shortname">cyberchallenger</span> will provide you with informationabout whether we hold any of your Personal Information. You can review, update, or correct thisPersonal Information by emailing. To opt-out of receiving our newsletters, you can follow theunsubscribe instructions at the bottom of our emails or contact us at the above email address.We will respond to your request within 30 days. Customers cannot opt out of receivingtransactional emails related to their account with us.</p><h3>Contact details</h3><p><span class="site_shortname">cyberchallenger</span> Inc.<br>1178 Broadway <br>2nd Floor #1011 <br>New York, NY 10001<br></p></div></div></div></div><div id="teams-modal" class="modalWindow modalWindowPage" style="display: none;"><div class="content"><div class="tournaments-list teams-page"><div class="top-block"><div class="cls_5"><div class="header section_header"><h1 class="section_title"><span class="t_lang" data-lang="teams_teamsStatistics">Teams statistics</span></h1></div><div id="app"><div class="section_filters col-xs-12"><div class="row"><div class="filters"><div class="col-lg-4 col-md-6 col-sm-6 col-xs-12"><div class="filter__wrapper filters__with-title"><div class="filter_title-wrap"><div class="filters_title">Filters:</div></div><div class="dropdown"><div class="dropdown_input"><input placeholder="Select Game" type="search" class="dropdown_input-search t_lang_attr" data-lang="teams_selectGame" data-lang-attr="placeholder" id="team_gsel_input" oninput="filterGame(this.value)"><span id="team_gsel"></span></div><div class="dropdown-icon"><svg width="10" height="6" viewBox="0 0 10 6" fill="none" xmlns="http://www.w3.org/2000/svg" class="dropdown-icon-dropdown"><path d="M1.175 0L5 3.7085L8.825 0L10 1.1417L5 6L0 1.1417L1.175 0Z" fill="#B3B3B4"></path></svg></div></div></div></div><div class="col-lg-8 col-md-8 col-sm-8 col-xs-12 filters-search"><div class="filter__wrapper"><div class="custom_input filters__search"><input type="search" id="search" name="search" value="" 